// Reaktion.js
import React from 'react';
import Banner from "src/components/banner.js";
import Footer from "src/components/footer.js";
import "src/styles/reaktion.css";

function Article(){
    return <div class="articleReaktion"></div>;
}

function Aside(){
    return <div class="asideReaktion"></div>;
}

function Reaktion(){
    return <div class="grid" style={{width: "70vw", margin: "auto"}}>
        <Banner/>
        <Article/>
        <Aside/>
        <Footer/>
    </div>;
}

export default Reaktion;
